import React from "react";

class CardNotas extends Component
{
    render()
    {
        return(
            <section>
                <header>
                    <h3>Titulo</h3>
                </header>
                    <p>Escreva sua nota</p>
            </section>
        )
    }
}

export default CardNotas;
